import React from 'react';
import './signup.css';

class SignUp extends React.Component {
    render() {
        return (
            <form>
                <legend>
                    <h1>Hello, Sign up now!</h1>
                    Username:
                    <br />
                    <input type="text" name="username"/>

                    <br/>

                    Password: 
                    <br />
                    <input type="text" name="password"/>

                </legend>
            </form>
        );
    };
};

export default SignUp;
